import React from "react";

function Login() {
  return (
    <div> 
    <section className="cover-user bg-white">
  <div className="container-fluid px-0">
    <div className="row no-gutters position-relative">
      <div className="col-lg-4 cover-my-30 order-2">
        <div className="cover-user-img d-flex align-items-center">
          <div className="row">
            <div className="col-12">
              <div className="card login-page border-0" style={{zIndex: 1}}>
                <div className="card-body p-0">
                  <div className="text-center" style={{borderBottom: '1px solid #ddd'}}>
                    <img className="text-center" src="http://simona.bappedajatim.id/uploads/dc22d440f6e1722adeacfa96f4076a3e.png" style={{height: 75}} />
                    <h4>Sistem Informasi Monitoring Pelaksanaan Pembangunan Daerah</h4>
                  </div>
                  <h4 className="card-title text-center">Login</h4>  
                  <form className="login-form mt-4" id="login-form">
                    <div className="row">
                      <div className="col-lg-12 mb-3">
                        <div className="form-group">
                          <label>Username / Email <span className="text-danger">*</span></label>
                          <div className="form-icon position-relative">
                            <i data-feather="user" className="fea icon-sm icons" />
                            <input type="text" className="form-control pl-5" placeholder="Username / Email" name="username" id="username" required />
                          </div>
                        </div>
                      </div>{/*end col*/}
                      <div className="col-lg-12 mb-3">
                        <div className="form-group">
                          <label>Password <span className="text-danger">*</span></label>
                          <div className="form-icon position-relative">
                            <i data-feather="key" className="fea icon-sm icons" />
                            <input type="password" name="password" id="password" className="form-control pl-5" placeholder="Password" required />
                          </div>
                        </div>
                      </div>{/*end col*/}
                      <div className="col-lg-12 mb-3">
                        <div id="login-result" />
                      </div>
                      <div className="col-lg-12 mb-3">
                        <button type="submit" className="btn btn-primary btn-block">Login</button>
                      </div>{/*end col*/}
                    </div>{/*end row*/}
                  </form>
                </div>
              </div>
            </div>{/*end col*/}
          </div>{/*end row*/}
        </div> {/* end about detail */}
      </div> {/* end col */}    
      <div className="col-lg-8 offset-lg-4 padding-less img order-1" style={{backgroundImage: 'url("http://simona.bappedajatim.id/assets/public/images/simona-login.jpeg")'}} data-jarallax="{&quot;speed&quot;: 0.5}" />{/* end col */}    
    </div>{/*end row*/}
  </div>{/*end container fluid*/}
</section>

  </div>  
  );
}

export default Login;
